import React from 'react';
import { View, Text, StyleSheet, TouchableOpacity } from 'react-native';

const App = () => {
  return (
    <View style={styles.container}>
      <View style={styles.background}></View>
      <View style={styles.circle}></View>
      <Text style={styles.title}>GROW {"\n"}YOUR BUSINESS</Text>
      <Text style={styles.subtitle}>We will help you to grow your business using {"\n"}online server</Text>
      <TouchableOpacity style={styles.buttonContainer}>
        <View style={styles.button}>
          <Text style={styles.buttonText}>LOGIN</Text>
        </View>
      </TouchableOpacity>
      <TouchableOpacity style={styles.buttonContainer}>
        <View style={styles.button}>
          <Text style={styles.buttonText}>SIGN UP</Text>
        </View>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    width: 360,
    height: 640,
    backgroundColor: 'white',
    position: 'relative',
  },
  background: {
    width: 360,
    height: 640,
    backgroundColor: '#00CCF9',
    position: 'absolute',
  },
  circle: {
    width: 140,
    height: 140,
    borderRadius: 9999,
    borderWidth: 15,
    borderColor: 'black',
    backgroundColor: 'rgba(196, 196, 196, 0)',
    position: 'absolute',
    left: 110,
    top: 105,
  },
  title: {
    position: 'absolute',
    left: 86,
    top: 297,
    textAlign: 'center',
    color: 'black',
    fontSize: 25,
    fontFamily: 'Roboto',
    fontWeight: '700',
  },
  subtitle: {
    position: 'absolute',
    left: 29,
    top: 417,
    textAlign: 'center',
    color: 'black',
    fontSize: 15,
    fontFamily: 'Roboto',
    fontWeight: '700',
  },
  buttonContainer: {
    position: 'absolute',
  },
  button: {
    width: 119,
    height: 48,
    borderRadius: 10,
    backgroundColor: '#E3C000',
    position: 'absolute',
  },
  buttonText: {
    position: 'absolute',
    left: 0,
    right: 0,
    top: 13,
    textAlign: 'center',
    color: 'black',
    fontSize: 20,
    fontFamily: 'Roboto',
    fontWeight: '700',
  },
});

export default App;
